import React from 'react';
import { useHistory } from 'react-router-dom'; // Import useHistory to programmatically navigate
import './../../css/Doctor/TopNavigationBar.css'; // Adjust the path to your CSS file

function TopNavigationBar({ patientName, onSignOut }) {
  const history = useHistory();

  const handleEditDetails = () => {
    history.push('/doctoreditdetails');
  };

  const handleSignOut = () => {
    history.push('/');
    onSignOut(); // Call the onSignOut function after navigating
  };

  return (
    <div className="top-navbar">
      <span>Welcome, {patientName}</span>
      <div className="right-links">
        <button className="edit-details-link" onClick={handleEditDetails}>
          Edit Details&nbsp;&nbsp;&nbsp;
        </button>
        <button className="signout-link" onClick={handleSignOut}>
          Sign Out
        </button>
      </div>
    </div>
  );
}

export default TopNavigationBar;
